import React from "react";
import { Link } from "react-router-dom";

const Header1 = () => {
  return (
    <div className="ui secondary pointing menu">
      <Link to="/" className="item">
        Streamin'
      </Link>
      <div className="right menu">
        <Link to="/" className="item">
          All Stcreams
        </Link>
      </div>
    </div>
  );
};

export default Header1;
